import React from "react";

function Header() {
  return (
    <Wrap>
      <Logo>Logo</Logo>
      <HeaderItems>
        <HeaderItem>1</HeaderItem>
        <HeaderItem>2</HeaderItem>
        <HeaderItem>3</HeaderItem>
      </HeaderItems>
    </Wrap>
  );
}

export default Header;
